import './App.css';
import { Select } from './Select';






const App = () => {
  const options = [{label: "apple", value: 1, selected: false}, {label: "pear", value: 2, selected: false}, {label: "banana", value: 3, selected: false}]

  return (
    <><Select options={options} isMulti={true} />
    <Select options={options} isMulti={false} />
    </>

  );
}

export default App;
